<b><u>Online Library</u></b>
<br>
Books for Asia puts brand-new books and digital content into the hands of students, educators, and leaders in 20 countries to increase their access to valuable information. Through technology and book donations, we infuse students with a love of reading essential for literacy; build knowledge in the business, legal, and science professions; sharpen vocational and research ability; and enhance language skills to participate in the global economy. Our digital initiative—Let’s Read—creates, translates, and delivers educational content to children any time, any place, in languages they use at home and school, dramatically improving access. This year, Books for Asia was honored by the U.S. Library of Congress Literacy Awards for innovations in literacy promotion. While print remains an effective means of delivering information in many parts of the developing world, e-books are fast becoming a cost-effective, scalable model given mobile technology’s increasing affordability.

Aryyas means cluster of stars, it’s to delight and embrace all with warmth and happiness. We welcome all to enjoy and cherish our hospitality.</center>


